import React from 'react';
import './App.css';




function CounterComponent() {
  let count = 0
  function handler() {
    count +=1
    alert({count})
    console.log(count)
  }

  return (
    <button onClick = {handler}>
      Counter: {count}
      </button>
  )
}





const obj: {name:string; year:string} = {
  name:'Lesson',
  year:'2025',
}

function Inner(props: { year: string} ) {
  return (
    <div>
      <h2>date start {props.year}</h2>
    </div>
  )
}

function Test(props: { name: string; year: string}) {
  return (
    <div>
      <h1>start project {props.name}</h1>
      <Inner year = {props.year}/>
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Test {...obj}/>
      <CounterComponent/>
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <p>
          Edit <code>src/App.js</code> HELLO
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
